ers: @chars\",\"taskDescription\":\"<p>a- Indicate the necessary time to complete the digestion of each meal:<br />\\n- rich in fibers<br />\\n- poor in fibers</p>\\n\\n<p> </p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"fd6f1abc-aaa5-4a3c-98bb-a8da7be7dfc1\"},{\"params\":{\"inputFieldSize\":\"1\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>b- Derive the role of fibers in digestion.</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"fecea902-6a71-4e1e-8e31-dbdabee87e3a\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"3- By refferring to the graph\",\"authors\":[],\"changes\":[],\"extraTitle\":\"3- By refferring to the graph\"},\"subContentId\":\"43dfb363-989d-48a8-af94-e8cf4667ac14\"},{\"params\":{\"helpTextLabel\":\"More information\",\"helpText\":\"\",\"elementList\":[{\"params\":{\"text\":\"<p>3-a The necessary time to complete digestion of the meal<br />\\n- rich in fibers is 15 hours<br />\\n- poor in fibers is 30 hours (1 pt.)</p>\\n\\n<p>3-b The fibers accelerate the digestion of food. (1 pt.)</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"c4dfbe41-b32a-467d-915d-991d2fbe5b5c\"}]},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Click here for the right answers.\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Click here for the right answers.\"},\"subContentId\":\"231f11a3-f911-42dd-bdac-d7557da03ae1\"}],\"i10n\":{\"previousLabel\":\"Previous\",\"nextLabel\":\"Next\",\"closeLabel\":\"Close\"}},\"library\":\"H5P.DocumentationTool 1.8\",\"metadata\":{\"contentType\":\"Documentation Tool\",\"license\":\"U\",\"title\":\"Untitled Documentation Tool\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Untitled Documentation Tool\"},\"subContentId\":\"768470fa-a564-4d02-b6a8-f87e23b0dd39\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"text\":\"<p><span style=\\\"color:#c0392b\\\"><em><strong><span style=\\\"font-size:1.25em\\\">Guide for your answers</span></strong></em></span></p>\\n\\n<p>1- Try to mentally visualize the digestive tube from the mouth down to the large intestine. You must have memorized the names of these organs by now. Remember, the digestive tube includes only organs where food passes. Not all organs of the digestive system!</p>\\n\\n<p>2- To convert a graph to a table, you must first establish the different variables. Notice that you have two graph lines, which means that you have two different dependent variables. The values already given in the \\\"drag and drop\\\" table will help you determine which row corresponds to the first dependent variable and which corresponds to the second.</p>\\n\\n<p>3- a - The necessary time to complete digestion corresponds to the time where digestion is 100%. For the meal poor in fibers, you will have to find the time in the graph, it is not given in the table.<br />\\n3- b - You must use the words \\\"accelerates\\\" or \\\"slows down\\\"... when it takes less time does it mean that it is accelerated or slowed down?</p>\\n\\n<p> </p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"9ff40d30-6ebc-4174-8d53-96b65a8b3eda\"},\"useSeparator\":\"auto\"}]}","library":"H5P.Column 1.15","contentUrl":".","metadata":{"license":"CC BY-NC-ND","title":"2010 - Session 2 - Exercise 4","defaultLanguage":"und","authors":[{"name":"LAL-Tabshoura","role":"Author"}],"licenseVersion":"4
